import React, {useEffect, useState} from 'react';
import { useFrontContext } from '../providers/frontContext';

function Tutorial() {
  const context = useFrontContext();
  const [companyStats, setCompanyStats] = useState({});

  const frontuserID = context.teammate.id;

  useEffect(() => {
    // Pseudo-code for fetching data from an external API or database
    setCompanyStats(
      {
        'company': 'Blue Rose Labs',
        'accountNumber': 54968483,
        'activeOrder': 8347
      }
    );
  }, []);

  return (
    <div class = "button-container">
      <div class = "textinput">
      <label htmlFor="input">Enter text:</label>
      <input type="text" id="slackStatusText" value= {value} onChange={handleChange}/>
      <label htmlFor="input">Enter emoji code:</label>
      <input type="text" id="slackStatusText" value= {value} onChange={handleChange}/>
      </div>
        <button onClick={handleClick} disabled={buttonClicked}>
          {buttonClicked ? 'Changing Status...' : 'Change Status'}
        </button>
    </div>
  );
}

export default Tutorial;
